import InputForm from '../input-form/input-form';
import Button from '../button/button';

const SignInForm = ({logGoogle}) => {
  return (
    <div>
      <form onSubmit={()=> {}}>
        <InputForm
          label='이메일'
          type='email'
          value=''
        ></InputForm>

        <InputForm
          label='비밀번호'
          type='email'
          value=''
        ></InputForm>

      </form>
      <Button onClick={logGoogle} type='submit' buttonType='google' ></Button>
    </div>
  )
}

export default SignInForm;
